column13:
A method of indicating hazards to a driver of a motor vehicle, the method comprising: 
determining the presence of a potential hazard; 
determining a direction to the potential hazard relative to the driver of the motor vehicle; 
selecting one or more of a plurality of speakers provided in the motor vehicle and surrounding the driver, the one or more speakers being in substantially the same direction relative to the driver as the potential hazard; and 
emitting a warning sound from said one or more speakers.

